INSERT INTO `api_info` VALUES (5,'每日一言','每日一言，欢迎对接','yiyan','https://v.api.aa1.cn/api/yiyan/index.php','HTML','GET','https://v.api.aa1.cn/api/yiyan/index.php','','<p>看蓬门秋草，年年破巷，疏窗细雨，夜夜孤灯。——郑燮</p>','1',1,'2022-11-19 17:25:56',0,1,'https://tucdn.wpon.cn/2022/10/24/091aa55588b0e.webp','生活',NULL,'夏柔','原创'),(2,'全国行政规划数据库','全国省市区镇村【五级版】，数据来源于国家统计局，私有化部署，托管至<code>字节跳动</code>','api-xz','https://zj.v.api.aa1.cn/api/xz/','JSON','GET','https://zj.v.api.aa1.cn/api/xz/?code=654028207203','暂无示例,站长交流群：938564996 进行交流','{\r\n	\"code\": 200,\r\n	\"ID\": \"654028207203\",\r\n	\"msg\": \"查询成功，查询花费0.0002秒\",\r\n	\"data\": {\r\n		\"Name\": \"阔克托干村\",\r\n		\"Province\": \"新疆维吾尔自治区\",\r\n		\"City\": \"伊犁哈萨克自治州\",\r\n		\"District\": \"尼勒克县\",\r\n		\"Tow\": \"喀拉托别乡\",\r\n		\"Villag\": \"阔克托干村\",\r\n		\"LevelType\": \"5\"\r\n	}\r\n}',NULL,1,'2022-11-19 17:30:08',0,0,'https://tucdn.wpon.cn/2022/11/20/21d6e4ba5bc97.svg','生活','2022/11/20','夏柔','原创'),(4,'伪原创api -免费接口 ','同行伪原创接口，可对接<br>此Api开发者联系QQ：<code>599858092\r\n</code>','other-wyc','http://cj.lycecho.com/api_form.php?key=test123','JSON','POST','http://cj.lycecho.com/api.php?ln=0&table=0&title=0&video=0&sw=0&a=0&gre=1&class=1&br=0&auto_href=1&href_times=3&key=test123&v=1&json=0','暂无示例,站长交流群：938564996 进行交流','关于恋人的作文。 各位读者好！你有你的木棉，我有我的文章。为了你的木棉，你应该看看我的文章！如果它是和我一起飞翔的鸟，它一定是世界上的情人！如果你读了这篇优秀的文章，你将成为天空中长翅膀的鸟！ 星星太美了，我不忍移开视线。不知道夸了多少次“今天星星真多，好亮！”直到钱说：“如今的星星好美，我看着都不腻。但是你越谈论他们，我就越恼火。”那样仰望夜空真的很开心。但这是短暂的。当我回家的时候，我再次仰望夜空。星星早就消失了。也许这样的美只有在农村才能看到。幸福是如此短暂。我一直记得有人告诉我，幸福其实很简单。有那么简单，会随着时间的推移而淡化吗？曾经发誓要永远在一起。然而现在，我是唯一一个仰望夜空的人。天很黑，让我觉得心里空荡荡的。一不注意就会被掏空。看看城市里的灯光。12点了，天还是那么亮，我的心一刻也不得安宁。我已经厌倦了。曾经厌倦了农村的污秽，现在厌倦了城市的喧嚣。这样看来，世界上没有什么是可以永恒的。我知道世界上没有一个地方是完美的。然而，每个人心中都有一个梦想的地方。那是你给我的梦想。我喜欢幻想。幻想可以和你一起回到过去。然而，毕竟你跟我说了再见，也许再也见不到我了。可以吗？这只是一次彩排。我真想时光倒流。回去，寻找过去的快乐和幸福。陌生人真的很痛苦，因为我过不去。我看了自己的一个视频，苦笑了一下。我一直在模仿你的习惯。你说喜欢，就算不喜欢，也会附和说喜欢。你明明喜欢，也要说不喜欢。说你喜欢绿色，但不喜欢紫色。因为绿色是活着的。喜欢紫色的人太有表现力了。你说你不喜欢。我沉默。你说你不喜欢百合，可你说它那么憔悴，却非要装出一副高贵的样子。我的心被震撼了。我一直喜欢百合花。我的英语也是莉莉。我一直很脆弱，却一直假装坚强。你说讨厌，我继续沉默。毕竟都过去了。小心，还是不能阻止你离开。终于再见了。 各位读者好！你有你的木棉，我有我的文章。为了你的木棉，你应该看看我的文章！如果它是和我一起飞翔的鸟，它一定是世界上的情人！如果你读了这篇优秀的文章，你将成为天空中长翅膀的鸟！','1',1,'2022-11-08 12:35:07',0,0,'https://tucdn.wpon.cn/2022/11/07/efae18a8048db.svg','生活',NULL,'熊猫','原创'),(106,'安慰文案','乖乖，不要不高兴啦～','api-wenan-anwei','https://v.api.aa1.cn/api/api-wenan-anwei/index.php','JSON','GET','https://v.api.aa1.cn/api/api-wenan-anwei/index.php?type=json','暂无示例,站长交流群：938564996 进行交流','{\r\n    \"anwei\":\"几乎所有事情都是两面性的，如只看消极的一面，心情自然会低落郁闷。让自己换个角度，从积极的一面看待问题吧，那样会让你走出心情低谷的。\"\r\n}',NULL,1,'2022-11-08 12:33:55',0,0,'https://tucdn.wpon.cn/2022/11/08/fff9b6fddf000.svg','生活','2022/11/08','夏柔','原创'),(107,'扒站接口爬虫版','爬取目标站静态资源，接口由浑欲不胜簪维护','api-bz-scrapy','https://v.api.aa1.cn/api/api-bz/temp.php','JSON','GET','https://v.api.aa1.cn/api/api-bz/temp.php?url=www.aa1.cn','暂无示例,站长交流群：938564996 进行交流','{    \r\n    \"code\":1,\r\n    \"msg\":\"已扒取成功\",\r\n    \"downloadurl\":\"https://v.api.aa1.cn/api/api-bz/down/www.aa1.cn.zip\"\r\n}',NULL,1,'2022-11-08 14:24:20',0,0,'https://tucdn.wpon.cn/2022/11/08/ea5deafdacc5a.svg','站长工具','2022/11/08','浑欲不胜簪','原创'),(109,'微博查绑泄密','v1版微博自查泄密，查询优化0.02毫秒，严禁违法用途','api-weibo','https://api.aa1.cn/api/api-weibo/','JSON','GET','https://v.api.aa1.cn/api/api-weibo/','暂无示例,站长交流群：938564996 进行交流','{\r\n\"weibo_id\":\"111111111\",\r\n\"phone\":\"13333333333\"\r\n}',NULL,1,'2022-11-19 13:03:36',0,0,'https://tucdn.wpon.cn/2022/11/09/4d477bce3a5c3.svg','生活','2022/11/09','夏柔','原创'),(110,'高质量小姐姐秒播线路','【秒播线路】高质量现爬抖音各种小姐姐视频，可以说是精品中的精品<br>汇聚：<code>陈佩奇</code>，<code>程女士</code>，<code>万小七</code>，<code>爆胎草莓酱</code>，<code>井川里予</code>，<code>巨型萝莉</code>，<code>蔡萝莉</code>， <code>一栗小莎子</code>，<code>菜菜</code>...等知名女网红（无忧集团旗下艺人...太多不展示了）<br>大量抖音现产<code>变装</code>','girl-11-08-ml','https://v.api.aa1.cn/api/api-girl-11-02/index.php','JSON','GET','https://v.api.aa1.cn/api/api-girl-11-02/index.php?type=json','暂无示例,站长交流群：938564996 进行交流','{\r\n    \"error\": 0,\r\n    \"result\": 200,\r\n    \"mp4\": \"\\/\\/ml.v.api.aa1.cn\\/girl-11-02\\/\\/video\\/-巨蟹女--反差吗？---抖音.mp4\"